import React from "react";
import NavBarItem from "./NavBarItem";

function TopNavBar() {
    return <div className="topNavBar">
        <NavBarItem href="#file" title="File" />
        <NavBarItem href="#home" title="Home" />
        <NavBarItem href="#insert" title="Insert" />
        <NavBarItem href="#draw" title="Draw" />
        <NavBarItem href="#view" title="View" />
        <NavBarItem href="#help" title="Help" />
        <a href="#home"><div className="topBarText">Home</div></a>
        <a href="insert"><div className="topBarText">Insert</div></a>
        <a href="#draw"><div className="topBarText">Draw</div></a>
        <a href="#view"><div className="topBarText">View</div></a>
        <a href="#help"><div className="topBarText">Help</div></a>
    </div>;
}

export default TopNavBar;
